INSERT INTO `Movie` VALUES (59,'ngoc@gmail.com',NULL,NULL,'2023-12-21 17:53:43.052254','ENABLE','Aquaman and the Lost Kingdom','COMING_SOON','2023','123','Mỹ',4.00,'Black Manta, still driven by the need to avenge his father\'s death and wielding the power of the mythic Black Trident, will stop at nothing to take Aquaman down once and for all. To defeat him, Aquaman must turn to his imprisoned brother Orm, the former King of Atlantis, to forge an unlikely alliance in order to save the world from irreversible destruction.','2023-12-23 10:52:41.163000','2023-12-22 10:52:37.899000','The tide is turning.','2023-12-23 10:39:47.108000','2023-12-30 10:39:49.599000'),(60,'admin1@gmail.com',NULL,NULL,'2023-12-21 19:14:06.763683','ENABLE','Trolls Band Together','PREMIERING','2023','123','Mỹ',7.00,'When Branch\'s brother, Floyd, is kidnapped for his musical talents by a pair of nefarious pop-star villains, Branch and Poppy embark on a harrowing and emotional journey to reunite the other brothers and rescue Floyd from a fate even worse than pop-culture obscurity.','2023-12-27 12:13:19.392000','2023-12-20 12:13:17.091000','There are some new trolls on the block.','2023-12-19 12:13:36.577000','2023-12-25 12:13:39.078000'),(61,'admin1@gmail.com',NULL,NULL,'2023-12-21 19:18:10.588732','ENABLE','Godzilla Minus One','PREMIERING','2023','119','Mỹ',6.00,'In postwar Japan, a new terror rises. Will the devastated people be able to survive... let alone fight back?','2023-12-23 12:17:33.999000','2023-12-20 12:17:31.712000','Postwar Japan. From zero to minus.','2023-12-20 12:17:50.399000','2023-12-30 12:17:53.546000'),(62,'admin1@gmail.com',NULL,NULL,'2023-12-21 19:21:23.815586','ENABLE','Migration','COMING_SOON','2023','123','Mỹ',8.00,'After a migrating duck family alights on their pond with thrilling tales of far-flung places, the Mallard family embarks on a family road trip, via New York City, to tropical Jamaica.','2023-12-22 12:20:47.660000','2023-12-22 12:20:44.752000','Odd ducks welcome.','2023-12-23 12:21:08.706000','2023-12-31 12:21:10.761000'),(63,'admin1@gmail.com',NULL,NULL,'2023-12-21 19:25:13.815355','ENABLE','Thanksgiving','COMING_SOON','2024','123','Mỹ',9.00,'After a Black Friday riot ends in tragedy, a mysterious Thanksgiving-inspired killer terrorizes Plymouth, Massachusetts - the birthplace of the holiday. Picking off residents one by one, what begins as random revenge killings are soon revealed to be part of a larger, sinister holiday plan.','2023-12-22 12:24:34.531000','2023-12-21 12:24:31.949000','There will be no leftovers.','2023-12-23 12:24:51.209000','2023-12-24 12:24:54.102000');
